import React, { useState, useEffect } from "react";
import { ReactSession } from 'react-client-session';
import Header from '../common/Header';
import { Link, useNavigate } from 'react-router-dom';
import Head from '../common/Head';
import Loader from "../common/Loader";
import { KETO_IMG_CDN_LIVE } from "../../config/constants";


export default function Part6() {


    ReactSession.setStoreType('localStorage');
    let history = useNavigate();
    const [urlPre, setUrlPre] = useState("");
    const [isLoading, setIsLoading] = useState(false);

    useEffect(() => {
        if (ReactSession.get('Get_typical_day_for_you') == undefined) {
            history('/');
        }

        if (window.location.pathname.split('/')[1] === "men") {
            setUrlPre("/men");
        }
        else if (window.location.pathname.split('/')[1] === "women") {
            setUrlPre("/women")
        }
        else if (window.location.pathname.split('/')[1] === "over40") {
            setUrlPre('/over40');
        }
        else {
            setUrlPre("");
        }

        setTimeout(() => {
            setIsLoading(true); // Set loading state to false
        }, 250);

    });

    if (ReactSession.get('Get_typical_day_for_you') == undefined) {
        return false;
    }

    const storeClick = event => {
        let clicked = event;
        ReactSession.set('part6', clicked);
    }

    //======================GET API======================

    var typical_day_for_you_data = ReactSession.get('Get_typical_day_for_you')['categoryItems'];
    const data = [];
    Object.keys(typical_day_for_you_data).forEach(key => data.push({ value: typical_day_for_you_data[key] }))

    //======================GET API======================
    if (isLoading === false) {
        return (
            <>
                <Loader />
            </>
        );
        return false;
    }


    return (
        <div>
            <Header />
            <div className='bodly'>
                <div className='tit'><h1>{ReactSession.get('Get_typical_day_for_you')['title2']}</h1></div>

                {
                    data.map((rows, Keynumber) => (
                        ReactSession.get('part6') ? (
                            ReactSession.get('part6').includes(rows.value.itemId) ? (
                                <Link to={urlPre + "/part7.html"} key={Keynumber} onClick={() => { storeClick(rows.value.itemId) }}>
                                    <div className='box1ac'>
                                        <div className='subtit1'><span>{rows.value.name}</span></div>
                                        <div><img src={KETO_IMG_CDN_LIVE + "/checked1.webp"} height={17} width={17} alt="checked" /></div>

                                    </div>
                                </Link>
                            ) : (
                                <Link to={urlPre + "/part7.html"} key={Keynumber} onClick={() => { storeClick(rows.value.itemId) }}>
                                    <div className='box1'>
                                        <div className='subtit1' style={{ textAlign: "left" }}><span>{rows.value.name}</span></div>
                                    </div>
                                </Link>
                            )
                        ) :
                            (
                                <Link to={urlPre + "/part7.html"} key={Keynumber} onClick={() => { storeClick(rows.value.itemId) }}>
                                    <div className='box1'>
                                        <div className='subtit1' style={{ textAlign: "left" }}><span>{rows.value.name}</span></div>
                                    </div>
                                </Link>
                            )

                    ))
                }
            </div>
        </div>
    )
}
